    public static class PopulateDatabase
    {
        public static void Initialize(IServiceProvider serviceProvider)
        {
            var userService = serviceProvider.GetRequiredService<IUserService>();

            using var context = new ToqueToqueContext(serviceProvider.GetRequiredService<DbContextOptions<ToqueToqueContext>>());
            PopulateAllergens(context);
            PopulateBookingStates(context);
            PopulateDifficulty(context);
            PopulateParticularity(context);
            PopulateTags(context);
            PopulateWithFakeData(context, userService);
        }

        /// <summary>
        /// Ajoute les allergènes dans la BDD si il n'y en a pas
        /// </summary>
        public static void PopulateAllergens(ToqueToqueContext context)
        {
            if (context.Allergens.Any())
                return;

            context.Allergens.AddRange(
                new AllergenDb
                {
                    Name = "Céréales"
                },
                new AllergenDb
                {
                    Name = "Crustacés"
                },
                new AllergenDb
                {
                    Name = "Oeufs"
                },
                new AllergenDb
                {
                    Name = "Poissons"
                },
                new AllergenDb
                {
                    Name = "Arachides"
                },
                new AllergenDb
                {
                    Name = "Soja"
                },
                new AllergenDb
                {
                    Name = "Lait"
                },
                new AllergenDb
                {
                    Name = "Fuits à coque"
                },
                new AllergenDb
                {
                    Name = "Céleri"
                },
                new AllergenDb
                {
                    Name = "Moutarde"
                },
                new AllergenDb
                {
                    Name = "Graines de sésame"
                },
                new AllergenDb
                {
                    Name = "Anhydride sulfureux et sulfites"
                },
                new AllergenDb
                {
                    Name = "Lupin"
                },
                new AllergenDb
                {
                    Name = "Mollusques"
                });

            context.SaveChanges();
        }


