        public static void PopulateWithFakeData(ToqueToqueContext context, IUserService userService)
        {
            #region Ajout d'un utilisateur

            if (!context.Users.Any())
            {
                userService.Create(new UserDb
                    {
                        Address = "4, rue des Lilas",
                        Email = "toto@ynov.com",
                        BirthDate = new DateTime(2000, 09, 13),
                        FirstName = "Alix",
                        LastName = "Hawer",
                        Phone = "0634567890",
                        ProfilePicture = base64ImageOne
                    },
                    "password");

                userService.Create(new UserDb
                    {
                        Address = "21 Rue Roger Radisson 69005 Lyon",
                        Email = "tom@ynov.com",
                        BirthDate = new DateTime(1996, 09, 14),
                        FirstName = "Tom",
                        LastName = "Sawyer",
                        Phone = "0634567890",
                        ProfilePicture = base64ImageTwo
                    },
                    "password");
            }

            #endregion

            #region Ajout des Plats (Meal)

            if (!context.Meals.Any())
            {
                var mealOne = new MealDb
                {
                    Title = "Desserts aux fruits",
                    Description = "Tofu sucré napée d'un coulis de fruits.",
                    RealizationTime = new TimeSpan(1, 30, 0),
                    LinkToFullMeal = "google.fr",
                    Difficulty = context.Difficulties.Find(2),
                    OwnerId = 2,
                    Particularity = context.Particularities.Find(1),
                    Pictures = new List<string> {"Public/Pictures/74b02ce1-7b7f-4b31-b350-0bd1ee6c6936.jpg"}
                };
                var allergenOne = context.Allergens.Find(1);
                mealOne.AllergenMeals = new List<AllergenMealDb>
                {
                    new AllergenMealDb
                    {
                        Allergen = allergenOne,
                        Meal = mealOne
                    }
                };
                context.Meals.Add(mealOne);
                context.SaveChanges();

                context.Meals.AddRange(
                    new MealDb
                    {
                        Title = "Poisson",
                        Description = "Poisson de merlue sous un lit de légumes.",
                        RealizationTime = new TimeSpan(0, 30, 0),
                        LinkToFullMeal = "google.fr",
                        Difficulty = context.Difficulties.Find(1),
                        OwnerId = 2,
                        Pictures = new List<string> {"Public/Pictures/74b02ce1-7b7f-4b31-b350-0bd1ee6c6935.jpg"}
                    }, new MealDb
                    {
                        Title = "Mousse au chocolat",
                        Description = "Mousse au chocolat accompagnée d'une glace",
                        RealizationTime = new TimeSpan(0, 0, 60),
                        LinkToFullMeal = "google.fr",
                        Difficulty = context.Difficulties.Find(3),
                        OwnerId = 2,
                        Pictures = new List<string> {"Public/Pictures/74b02ce1-7b7f-4b31-b350-0bd1ee6c6937.jpg"}
                    });

                context.SaveChanges();
            }

            #endregion

            #region Ajout des Sessions

            if (!context.Sessions.Any())
            {
                var sessionOne = new SessionDb
                {
                    Title = "Session desserts aux fruits",
                    Description = "Je vais recevoir des amis la semaine prochaine, et j'ai besoin de goûteurs :p",
                    Address = "3, rue des tulipes",
                    AvailableTickets = 1,
                    Created = DateTime.Now,
                    Creator = context.Users.First(x => x.FirstName == "Tom").Id,
                    EventStarting = new DateTime(2020, 02, 01, 18, 30, 00),
                    Price = 4.5M,
                    RegisteringStop = new DateTime(2020, 01, 20, 18, 30, 00),
                    SessionMeals = new List<SessionMealDb>
                    {
                        new SessionMealDb
                        {
                            MealId = context.Meals.First(x => x.Title == "Desserts aux fruits").Id
                        }
                    }
                };

                var geolocationOne = new GeolocationDb
                {
                    Latitude = 45.745716,
                    Longitude = 4.837755,
                    Session = sessionOne
                };
                sessionOne.Geolocation = geolocationOne;

                context.Sessions.AddRange(sessionOne);

                var sessionTwo = new SessionDb
                {
                    Title = "Session poisson de merlue",
                    Description = "J'aimerais partager avec vous une délicieuse recette de ma grand mère.",
                    Address = "4 rue des chaises",
                    AvailableTickets = 2,
                    Created = DateTime.Now,
                    Creator = context.Users.First(x => x.FirstName == "Tom").Id,
                    EventStarting = new DateTime(2020, 02, 01, 18, 30, 00),
                    Price = 4.5M,
                    RegisteringStop = new DateTime(2020, 01, 20, 18, 30, 00),
                    SessionMeals = new List<SessionMealDb>
                    {
                        new SessionMealDb
                        {
                            MealId = context.Meals.First(x => x.Title == "Poisson").Id
                        }
                    }
                };

                var geolocationTwo = new GeolocationDb
                {
                    Latitude = 45.758373,
                    Longitude = 4.832683,
                    Session = sessionTwo
                };
                sessionTwo.Geolocation = geolocationTwo;
                context.Sessions.AddRange(sessionTwo);

                context.SaveChanges();
            }

            #endregion

            #region Conversation

            if (!context.Conversations.Any())
            {
                var userOne = context.Users.Find(1);
                var userTwo = context.Users.Find(2);
                var conversation = new ConversationDb
                {
                    Name = "Conversation Dessert"
                };
                conversation.ConversationUser = new List<ConversationUserDb>
                {
                    new ConversationUserDb
                    {
                        Conversation = conversation,
                        User = userOne
                    },
                    new ConversationUserDb
                    {
                        Conversation = conversation,
                        User = userTwo
                    }
                };

                context.Conversations.Add(conversation);
                context.SaveChanges();
            }

            #endregion

            #region Messages

            if (!context.Messages.Any())
            {
                var messageOne = new MessageDb
                {
                    SendingTime = DateTime.UtcNow,
                    Text = "Hello World!",
                    UserId = 1,
                    ConversationId = 1
                };

                var messageTwo = new MessageDb
                {
                    SendingTime = DateTime.UtcNow,
                    Text = "Hi :)",
                    UserId = 2,
                    ConversationId = 1
                };

                context.Messages.Add(messageOne);
                context.Messages.Add(messageTwo);
                context.SaveChanges();
            }
            
            #endregion
        }

        private const string base64ImageOne =
